// RouterHandle.js
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import App from "./App";
import QuoteCheck from "./QuoteCheck";

function MyRouter() {
    return (
        <Router>
            <Routes>
                <Route path="/" element={<React.Fragment><App /></React.Fragment>} />
                <Route path="/quote-check" element={<React.Fragment><QuoteCheck /></React.Fragment>} />
            </Routes>
        </Router>
    );
}

export default MyRouter;
